import {useEffect, useState} from "react";


function PlatesFetching() {
    const [plates, setPlates] = useState([])
    const [id,setId] = useState(1)

    useEffect(() => {
        axios.get('http://localhost:8080/plates/${id}')
            .then(res=> {
                console.log(res)
                setPlates(res.data)
            })
            .catch(err => {
                console.log(err)
            })


    }, [])


    return(
        <div>
            <h2>Search for a Plate</h2>
                <input type="text" placeholder="Search..." className="registration-ui" value={id} onChange={e => setId(e.target.value)}/>
                    <ul>
                        {
                            plates.map(plate => <li key={plate.plateid}>{plate.registrationplate} - Â£{plate.cost}</li> )
                        }
                    </ul>
        </div>
    )
}

